BEGIN
    CALL PIPELINE_V2_GROOT_DB.PIPELINE_V2_GROOT_SCHEMA.BACKFILL_SUILEND_PORTFOLIO(
        DATEADD(day, -2, CURRENT_DATE()), -- START_DATE: Two days ago
        DATEADD(day, -1, CURRENT_DATE())  -- END_DATE: Yesterday
    );
END

DECLARE
        resset RESULTSET;
        query VARCHAR;
    BEGIN
    -- set an if-statement to assign the right column-name based on date...
        let ctp TIMESTAMP_TZ := (convert_timezone('America/Los_Angeles', current_timestamp()));
        let timecol string := 'bob';
    -- Block to pick the right column for anylsis
    -- starting in DaylightTime (thanks to congress for not killing dalyight/standard time despite 60%+ of Americans wanting it gone)
    IF     (ctp < convert_timezone('America/Los_Angeles', '2024-05-03 16:00:00'::timestamp_ntz)) then
        timecol := '2024-04-04';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-05-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-05-03';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-06-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-05-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-07-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-06-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-08-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-07-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-09-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-08-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-10-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-09-15';
    -- Now we change back to standard time
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-11-15 17:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-10-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2024-12-15 17:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-11-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2025-01-15 17:00:00'::timestamp_ntz)) then 
        timecol :=  '2024-12-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2025-02-15 17:00:00'::timestamp_ntz)) then 
        timecol :=  '2025-01-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2025-03-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2025-02-15';
    ELSEIF (ctp < convert_timezone('America/Los_Angeles', '2025-04-15 16:00:00'::timestamp_ntz)) then 
        timecol :=  '2025-03-15';
    ELSE
        timecol :=  '2025-04-15';
    END IF;
    -- 2024-05-01: Hotfix to add extra addresses for the 3-May unlock and through the 2024-05-15 unlock
    query := 'select wallet_address, "' || :timecol || '" 
                from (
                    SELECT * from tmp_lw
                    union all 
                    select 
                        wallet_address, 
                        "2024-04-04", 
                        "2024-05-03",
                        "2024-05-03" as "2024-05-15",
                        NULL as "2024-06-15",
                        NULL as "2024-07-15",
                        NULL as "2024-08-15",
                        NULL as "2024-09-15",
                        NULL as "2024-10-15",
                        NULL as "2024-11-15",
                        NULL as "2024-12-15",
                        NULL as "2025-01-15",
                        NULL as "2025-02-15",
                        NULL as "2025-03-15",
                        NULL as "2025-04-15"
                    from tmp_lw_schd2)'; -- Here we cut the input table to the correct date column
    resset := (execute immediate :query);

    -- Write this into a temp table to use below
    create or replace table tmp_lw_test_schd2 as select * from table(result_scan(last_query_id()));

    call system$set_return_value('updated locked wallet balances as of locked date ' || :timecol ||'.');
END

